import axios, { AxiosResponse } from 'axios';

class SearchFriendRepository {

    searchFriend(data) : Promise<AxiosResponse<any>>{
        const url = '';

        return axios({
            url,
            method : 'post',
            data : JSON.stringify(data)
        });
    }
}

export default new SearchFriendRepository();
